          <p> The Response is {movies.Response}</p>

          <div className="row"></div>
          <div></div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  movies: state.movies.movies,
  flims: state.movies.movies.Search,
});

export default connect(mapStateToProps)(MoviesContainer);
